// Efecto navBar Sticky
! function (e, n, t) {
    console.log("init");
    var o = {
        init: function (t) {
            o.navbarChange()
        },

        navbarChange: function () {
            e(n).scroll(function () {
                var t = e(n).scrollTop();
                return 150 < t ? (e("body").addClass("not-on-top")) : (e("body").removeClass("not-on-top")), !1
            })
        }
    };
    e(t).ready(function () {
        o.init(e)
    })
}(window.jQuery, window, document);
// FIN Efecto navBar Sticky


// ver PDF diplomatura y certificados
const certificadoUTN = document.getElementById("UTN");
const certificadoJS = document.getElementById("EducacionJS");
const educacionReact = document.getElementById("EducacionReact");

certificadoUTN.addEventListener("click", () => {window.open('certificados/Diplomatura.pdf', 'certificado', 'height=600,width=900')});
certificadoJS.addEventListener("click", () => {window.open('certificados/CertificadoJS.pdf', 'certificado', 'height=600,width=900')});
educacionReact.addEventListener("click", () => {window.open('certificados/CertificadoReact.pdf', 'certificado', 'height=600,width=900')});
// FIN ver PDF diplomatura y certificados


